import React from 'react'
import { Button } from './Button'

const Persons = ( {persons, newFilter} ) => {
    return (
        <div>
            <table>
                <tbody>
                    {persons.map((element, index) => {
                        if (element.name.search(newFilter) !== -1) return (
                            <tr>
                            <div key={index}>
                                <div>{element.name} {element.number} <button>Delete</button></div>
                            </div>
                            </tr>
                        )
                        else return null
                    })}
                </tbody>
            </table>
        </div>
    )
}

export { Persons }
